import React from "react"

import '../App.css';

export default function Navbar() {
    return (
        <nav>
            <img src="../react-icon-small.png" className="nav--icon" />

            <h3 className="nav--logo_text">ReactFacts</h3>
            <h4 className="nav--title">React Course - Project 1</h4>
        </nav>
)}
